import React from "react";
import List from "../components/List";
import ListItem from "../components/ListItem";
const index = ({ respond }) => {
    let arrayOfItems = Object.values(respond.terms);
    let dates = Object.keys(respond.terms);
    console.log(dates);
    let lists = arrayOfItems.map((i) => {
        const items = i.map((e) => {
            if (e.practice) return <ListItem>Praktyka : {e.practice[0].date}</ListItem>;
            if (e.theory) return <ListItem> teoria: {e.theory.date}</ListItem>;
        });

        return <List>{items}</List>;
    });
    return <div>{lists}</div>;
};

index.getInitialProps = async (ctx) => {
    const res = await fetch(
        "https://info-car.pl/services/word/ajax/getSchedule?wordId=44&examCategory=B&month=2020-06&_=1591862087288"
    );
    const json = await res.json();
    console.log(json);
    return { respond: json };
};
export default index;
